    false,nt"url": null,nt"notes": "While bats at the Great Dismal Swamp National
    Wildlife Refuge (GDSNWR) have relatively low mean blood and fur Hg concentrations
    compared to point source contamination sites, the mean blood and fur Hg concentrations
    were high compared to reference sites for the same studies (Nam et al. 2010; Yates
    et al. 2008; Divoll et al. 2009; Yates et al. 2006). The mean fur Hg concentration
    at the GDSNWR exceeded LOAEL found by Burton et al. (1977) and when excluding juveniles,
    concentration in adult bats were above the LOEL found by Nam et al. (2010). This
    suggests that some bats at the GDSNWR have Hg concentrations that are of concern.",nt"owner_org":
